using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Api_savino_Filmes.Models;
using Microsoft.AspNetCore.Mvc;

// For more information on enabling MVC for empty projects, visit https://go.microsoft.com/fwlink/?LinkID=397860

namespace Api_savino_Filmes.Controllers
{
    [ApiController]
    [Route("/api/directors/")]
    public class DirectorsController : ControllerBase
    { 
         private static List<DirectorModel> listaDiretores = new List<DirectorModel>();

        [AcceptVerbs("GET")]
        [Route("ConsultarDiretorPorCodigo/{codigo}")]
        public DirectorModel ConsultarUsuarioPorCodigo(int codigo)
        {
            DirectorModel ator = listaDiretores.Where(n => n.Id == codigo)
            .Select(n => n)
            .FirstOrDefault();
            return ator;
        }
        [AcceptVerbs("GET")]
        [Route("ConsultarDiretores")]
        public List<DirectorModel> ConsultarDiretores()
        {
            CarregarDiretores();
            return listaDiretores;
        }
        private void CarregarDiretores()
        {
            listaDiretores.Clear();
            listaDiretores.Add(new DirectorModel(1, "Quentin Tarantino", "data:image/jpeg;base64,"));
            listaDiretores.Add(new DirectorModel(1, "Steven Spielberg", "data:image/jpeg;base64,"));
            listaDiretores.Add(new DirectorModel(1, "Stanley Kubrick", "data:image/jpeg;base64,"));
            listaDiretores.Add(new DirectorModel(1, "Martin Scorsese", "data:image/jpeg;base64,"));
            listaDiretores.Add(new DirectorModel(1, "Ford Francis Coppola", "data:image/jpeg;base64,"));
        }
    }
}
